CREATE TABLE `evaluations` (
  `EvalID` int NOT NULL AUTO_INCREMENT,
  `GeneratedToken` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `FacilitatorID` varchar(12) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `EmpIDToEvaluate` varchar(12) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `DeptCode` varchar(25) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `Semester` varchar(25) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `SchoolYearFrom` mediumint NOT NULL,
  `SchoolYearTo` mediumint NOT NULL,
  `SectionCode` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `CourseCode` varchar(15) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `CourseDescription` varchar(150) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Schedule` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `BldgRoom` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Evaluator` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT 'STUDENT or HEAD',
  `TotalEvaluator` int DEFAULT NULL,
  `ParticipantsCount` int DEFAULT NULL,
  `QGID` int DEFAULT NULL,
  `FinalRating` decimal(11,2) DEFAULT NULL COMMENT 'Ave per specific section',
  `created_at` date DEFAULT NULL,
  `updated_at` date DEFAULT NULL,
  `deleted_at` date DEFAULT NULL,
  `EvalStatus` tinyint(1) DEFAULT NULL COMMENT '0 = newly created and student cant answer, 1 = trigger by faci and student could answer, 2 = done evaluation or closed',
  PRIMARY KEY (`EvalID`),
  KEY `FacilitatorID` (`FacilitatorID`),
  KEY `EmpIDToEvaluate` (`EmpIDToEvaluate`),
  KEY `QGID` (`QGID`),
  CONSTRAINT `Evaluations_ibfk_1` FOREIGN KEY (`FacilitatorID`) REFERENCES `employees` (`EmpID`),
  CONSTRAINT `Evaluations_ibfk_2` FOREIGN KEY (`EmpIDToEvaluate`) REFERENCES `employees` (`EmpID`),
  CONSTRAINT `Evaluations_ibfk_4` FOREIGN KEY (`QGID`) REFERENCES `questiongroups` (`QGID`)
) ENGINE=InnoDB AUTO_INCREMENT=4479 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
