INSERT INTO `questions` VALUES (26,10,'Informs the students what topics to take-up during the semester based on the course outline, syllabus or  Instructional Guide of the subject.',1,1,1,5,'2024-01-19','2024-03-22',NULL),(27,10,'Follows strictly the subject matter in the course outline, syllabus or Instructional Guide and stays within these  topics.',2,1,1,5,'2024-01-19',NULL,NULL),(28,10,' Explains the lesson very clearly. (Using examples related to everyday life, which you can actually see or  experience.)',3,1,1,5,'2024-01-19',NULL,NULL),(29,10,'Encourages student participation (such as assignments, seatwork, recitation, asking question, and others).',4,1,1,5,'2024-01-19',NULL,NULL),(30,10,'Attends and holds class the entire period -- both online and onsite. (Does not sleep, rest, read nor read  materials not related to the subject. Does not work on class records during the class. Does not entertain  visitors, calls or text messages.)',5,1,1,5,'2024-01-19',NULL,NULL),(31,10,'Begins class on time based on the school’s standard time. (There is a 5-minute allowance to transfer from  one room to the other for onsite.)',6,1,1,5,'2024-01-19',NULL,NULL),(32,10,' Ends class on time.',7,1,1,5,'2024-01-19',NULL,NULL),(33,10,' Is effective in the use of the language of instruction (or Filipino as required by the subject).',8,1,1,5,'2024-01-19',NULL,NULL),(34,10,'Corrects/shows/returns test papers, assignments, seatwork, term papers, reports, plates, experiments,  projects, etc.',9,1,1,5,'2024-01-19',NULL,NULL),(35,10,'Is fair in grading student performance. (No favoritism.)',10,1,1,5,'2024-01-19',NULL,NULL),(36,10,'Maintains discipline in the classroom -- both online and onsite. (No insulting, vulgar language, or  shouting. Does not easily get angry. Encourages cleanliness like picking up of papers scattered on the  floor. No spitting. No smoking. The class is well behaved.)',11,1,1,5,'2024-01-19',NULL,NULL),(37,10,'Entertains problems of students related to the subject inside or outside class hours within the school  premises.',12,1,1,5,'2024-01-19',NULL,NULL),(38,10,'Strictly prevents cheating.',13,1,1,5,'2024-01-19',NULL,NULL),(39,10,'Enforces and practices school policies properly and strictly like wearing of school ID and proper attire. (This  also includes examination periods.)',14,1,1,5,'2024-01-19',NULL,NULL),(40,10,'Avoids soliciting donations or loans in cash or in kind for personal use.',15,1,1,5,'2024-01-19',NULL,NULL),(41,10,'Avoids selling handouts, notes, pad paper, bond paper, folders or other items to the students or through  stores outside the School Canteen. (Photocopy of quiz questionnaire should be at cost, not more than ₱4 per  one (1) whole page. In another piece of paper specify items being sold.)',16,1,1,5,'2024-01-19',NULL,NULL),(42,10,' What are the strong points of your teacher?',17,0,0,0,'2024-01-19',NULL,NULL),(43,10,'How may your teacher’s method be improved?',18,0,0,0,'2024-01-19',NULL,NULL),(44,10,'Other comments',19,0,0,0,'2024-01-19',NULL,NULL),(48,11,'Class Records/Gradesheets (Including Midterm)',1,1,1,5,'2024-03-03',NULL,NULL),(49,11,'Other Reports ',2,1,1,5,'2024-03-03',NULL,NULL),(50,11,'Content(First Submission)',3,1,1,5,'2024-03-03',NULL,NULL),(51,11,'Quizzes',4,1,1,5,'2024-03-03',NULL,NULL),(52,11,'Attendance in Meetings and/ School Functions',5,1,1,5,'2024-03-03',NULL,NULL),(53,11,'The Teacher  is innovative and up-to-date In his/her teaching methodology',6,1,1,5,'2024-03-03',NULL,NULL),(54,11,'Uses instrunctional materials other than books, chalk, board, and handouts',7,1,1,5,'2024-03-03',NULL,NULL),(55,11,'Resorts to remedial measures such as holding extra classess if necessary',8,1,1,5,'2024-03-03',NULL,NULL),(56,11,'Shares extra time and effort to entertain his/her students\'s problems related to the subject.',9,1,1,5,'2024-03-03',NULL,NULL),(57,11,'Holds classes even with few students',10,1,1,5,'2024-03-03',NULL,NULL),(58,11,' Accepts and Performs regular duties satisfactorily',11,1,1,5,'2024-03-03',NULL,NULL),(59,11,'Does willingly extra work assigned to him/her',12,1,1,5,'2024-03-03',NULL,NULL),(60,11,'Accepts and perform regular duties satisfactorily',13,1,1,5,'2024-03-03',NULL,NULL),(61,11,'Controls and maintains order in the class',14,1,1,5,'2024-03-03',NULL,NULL),(62,11,'Corrects misconduct in a diplomatic way without Insulting the student concerned',15,1,1,5,'2024-03-03',NULL,NULL),(63,11,'Strictly enforces examination procedures and maintains safeguards againts cheating',16,1,1,5,'2024-03-03',NULL,NULL),(64,11,'Enforces and practicces properly and strictly school policies like wearing of Id and proper attire',17,1,1,5,'2024-03-03',NULL,NULL),(65,11,'Checks class attendance',18,1,1,5,'2024-03-03',NULL,NULL),(66,11,'Goes to class neat and in proper attire',19,1,1,5,'2024-03-03',NULL,NULL),(67,11,'Accepts constructive criticism',20,1,1,5,'2024-03-03',NULL,NULL),(68,11,'Refrains from rumor-mongering and character assasination',21,1,1,5,'2024-03-03',NULL,NULL),(69,11,'Controls his/her temper',22,1,1,5,'2024-03-03',NULL,NULL),(70,11,'Possesses manners so refined that obscene words and vulgar language are not in his/her vocabulary',23,1,1,5,'2024-03-03',NULL,NULL),(71,11,'Holds classess free from alchoholic beverages or prohibited drugs',24,1,1,5,'2024-03-03',NULL,NULL),(72,11,'Abides the Polices and Regulation of the College in particular and the School in general',25,1,1,5,'2024-03-03',NULL,NULL),(73,11,'Refrains from fraternizing with students',26,1,1,5,'2024-03-03',NULL,NULL),(74,11,'Deals with students fairly',27,1,1,5,'2024-03-03',NULL,NULL),(75,11,'Relates harmouniously with his/her fellow instructors',28,1,1,5,'2024-03-03',NULL,NULL),(76,11,'Observes ethics in dealing with his/her fellow instuctors and students',29,1,1,5,'2024-03-03',NULL,NULL),(77,11,'Shows Respect for superiros and school offcials.',30,1,1,5,'2024-03-03',NULL,NULL);
